import "../style/Profile.css";

const ProfilePage = () => {
  return (
    <div className="profile-box">
      <div className="container-img">
        <div className="cover-img"></div>
        <div className="profile-img"></div>
        <h1>Your Name</h1>
      </div>
    </div>
  );
};
export default ProfilePage;
